import axios from "axios";
import { toast } from "react-toastify";

export const getUsers = async () => {
  try {
    const response = await axios.get("http://localhost:8800");
    console.log(response)
    return response.data;
  } catch (error) {
    toast.error(error);
    throw error;
  }
};
